import { useNavigate } from "react-router-dom";
function Error404() {
    let navigate = useNavigate();
    const handleGoback = () => {
        navigate("/login", {replace: true});
    }
    return (  
    <div className="page-error">
    <div class="Error404">
       <h1 class="title">Error 404</h1>
       <p class="description">Oops! The page you're looking for doesn't exist.</p>
       <button class="goBack" onClick={handleGoback}>Go back</button> 
    </div>
    </div>
    )
 }
 
 export default Error404;
